import React from "react";
import Typed from "typed.js";

const Home = () => {
  return (
    <>
      <div className="container d-flex">
      <Typed
        strings={['Web Developer', 'Web Designer']}
        typeSpeed={50}
      />
        <div className="container text-center"></div>
      </div>
    </>
  );
};

export default Home;
